import { HTTP_URL } from "../App/Slices/baseurl";
import axios from "axios";
import { DraftList } from "../App/Types/champ-select-types";

export const getDraftList = () => {
   const draftList:DraftList = axios.get(`${HTTP_URL}/draftlist`)
   return draftList
}
